import java.io.PrintWriter;
import java.util.Scanner;

public class ThreeNPlusOne {

    public static void main(String[] args) throws Exception {

        Scanner in = new Scanner(System.in);
        PrintWriter out = new PrintWriter(System.out, true);

        int max;
        int counter;
        int number;

        while (in.hasNextInt()) {
            int i = in.nextInt();
            int j = in.nextInt();
            max = 0;

            for (int n = i; n <= j; n++) {
                number = n;
                counter = 1;
                while (true) {

                    if (number == 1) {
                        if (counter > max)
                            max = counter;
                        break;
                    } else if (number % 2 == 0) {
                        number = number / 2;
                        counter++;
                    } else {
                        number = 3 * number + 1;
                        counter++;
                    }

                }
            }

            out.printf("%d %d %d\n", i, j, max);
        }
    }
}
